import React from "react";
import {
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardActions,
  Button,
  Box,
  Chip,
  Hidden,
} from "@material-ui/core";
import { LogoLink } from "../components/logo/LogoLink";
import { ThemeToggle } from "../components/theme/ThemeToggle";
import { FooterText } from "../components/footer/FooterText";
import { SocialIcons } from "../components/content/SocialIcons";
import { NavigationButtons } from "../components/navigation/NavigationButtons";
import DisplacementSphere from "../components/background/DisplacementSphere";
import { makeStyles } from "@material-ui/core/styles";
import { TextDecrypt } from "../components/content/TextDecrypt";

const useStyles = makeStyles((theme) => ({
  root: {
    minHeight: "100vh",
    display: "flex",
    flexDirection: "column",
    position: "relative",
  },
  content: {
    marginTop: "auto",
    marginBottom: "auto",
    paddingTop: theme.spacing(8),
    paddingBottom: theme.spacing(8),
    zIndex: 1,
  },
  section: {
    marginBottom: theme.spacing(8),
  },
  sectionTitle: {
    marginBottom: theme.spacing(4),
    fontWeight: 700,
  },
  card: {
    height: "100%",
    display: "flex",
    flexDirection: "column",
    backgroundColor: "rgba(255, 255, 255, 0.05)",
    backdropFilter: "blur(10px)",
    border: `1px solid ${theme.palette.divider}`,
    transition: "all 0.3s ease",
    "&:hover": {
      transform: "translateY(-8px)",
      boxShadow: "0 12px 24px rgba(0, 0, 0, 0.15)",
      border: `1px solid ${theme.palette.primary.main}`,
    },
  },
  cardContent: {
    flexGrow: 1,
    padding: theme.spacing(3),
  },
  cardActions: {
    padding: theme.spacing(2, 3),
    justifyContent: "space-between",
  },
  projectTitle: {
    marginBottom: theme.spacing(2),
    fontWeight: 600,
  },
  description: {
    marginBottom: theme.spacing(2),
    lineHeight: 1.7,
  },
  techStack: {
    display: "flex",
    flexWrap: "wrap",
    gap: theme.spacing(1),
    marginTop: theme.spacing(2),
  },
  chip: {
    fontSize: "0.75rem",
    height: "24px",
  },
  header: {
    marginBottom: theme.spacing(6),
    textAlign: "center",
  },
  headerTitle: {
    fontWeight: 700,
    marginBottom: theme.spacing(2),
  },
}));

// Top Projects - Your best and most significant work
const topProjects = [
  {
    id: 1,
    title: "AI-Powered Portfolio Analyzer",
    description:
      "A sophisticated machine learning application that analyzes portfolio performance and provides real-time investment recommendations. Features advanced data visualization and predictive analytics.",
    technologies: ["React", "Python", "TensorFlow", "D3.js", "PostgreSQL"],
    link: "#",
    github: "#",
  },
  {
    id: 2,
    title: "Real-Time Collaboration Platform",
    description:
      "Enterprise-grade collaborative workspace with WebSocket integration for real-time editing, video conferencing, and project management. Supports 1000+ concurrent users.",
    technologies: ["Next.js", "Node.js", "Socket.io", "Redis", "MongoDB"],
    link: "#",
    github: "#",
  },
  {
    id: 3,
    title: "Smart IoT Dashboard",
    description:
      "Comprehensive IoT management system for monitoring and controlling smart devices. Includes data analytics, automation rules, and mobile companion app.",
    technologies: ["React Native", "Firebase", "Arduino", "MQTT", "AWS IoT"],
    link: "#",
    github: "#",
  },
];

// Step Projects - Learning journey and experimental projects
const stepProjects = [
  {
    id: 4,
    title: "Weather Forecast App",
    description:
      "Clean and intuitive weather application with 7-day forecasts, location-based detection, and beautiful weather animations.",
    technologies: ["React", "OpenWeather API", "CSS3"],
    link: "#",
    github: "#",
  },
  {
    id: 5,
    title: "Task Management System",
    description:
      "Simple yet effective task manager with drag-and-drop functionality, priority levels, and deadline reminders.",
    technologies: ["Vue.js", "Firebase", "Vuex"],
    link: "#",
    github: "#",
  },
  {
    id: 6,
    title: "Portfolio Website V1",
    description:
      "My first portfolio website showcasing early projects and learning journey in web development.",
    technologies: ["HTML5", "CSS3", "JavaScript"],
    link: "#",
    github: "#",
  },
  {
    id: 7,
    title: "Blog CMS",
    description:
      "Custom content management system for blogging with markdown support and SEO optimization.",
    technologies: ["Node.js", "Express", "MongoDB", "EJS"],
    link: "#",
    github: "#",
  },
  {
    id: 8,
    title: "Recipe Finder",
    description:
      "Search and discover recipes based on available ingredients. Features nutritional information and cooking instructions.",
    technologies: ["React", "Spoonacular API", "Material-UI"],
    link: "#",
    github: "#",
  },
  {
    id: 9,
    title: "Expense Tracker",
    description:
      "Personal finance management tool with expense categorization, budget tracking, and spending insights.",
    technologies: ["React", "Chart.js", "LocalStorage"],
    link: "#",
    github: "#",
  },
];

export const Projects = () => {
  const classes = useStyles();

  return (
    <>
      <LogoLink />
      <ThemeToggle />
      <Container className={classes.root} maxWidth="lg">
        <Box className={classes.header}>
          <Typography variant="h2" component="h1" gutterBottom>
            Projects
          </Typography>
          <Typography variant="h6" color="textSecondary">
            A showcase of my work and contributions
          </Typography>
        </Box>

        <Grid container spacing={4}>
          {projects.map((project) => (
            <Grid item key={project.id} xs={12} sm={6} md={4}>
              <Card className={classes.card}>
                <CardContent className={classes.cardContent}>
                  <Typography variant="h5" component="h2" gutterBottom>
                    {project.title}
                  </Typography>
                  <Typography variant="body2" color="textSecondary" paragraph>
                    {project.description}
                  </Typography>
                  <Box mt={2}>
                    {project.technologies.map((tech, index) => (
                      <Typography
                        key={index}
                        variant="caption"
                        component="span"
                        style={{ marginRight: 8 }}
                      >
                        #{tech}
                      </Typography>
                    ))}
                  </Box>
                </CardContent>
                <CardActions>
                  <Button size="small" color="primary" href={project.link}>
                    View Live
                  </Button>
                  <Button size="small" color="primary" href={project.github}>
                    GitHub
                  </Button>
                </CardActions>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
      <FooterText />
    </>
  );
};

export default Projects;
